const Lesson = require('../models/lessons');

class Lessons {

  async getAllLessons(req, res) {
    let data = await Lesson.find({});

    if (data.length) {
      res.json({message: 'ok', status: 200, data})
    } else {
      res.json({message: 'empty', status: 204, data})
    }
  }

  async getCurrentLesson(req, res) {
    let {grade_name, lesson_name} = req.query;

    if (!(grade_name && lesson_name)) {
      res.json({message: 'parameters lost', status: 400});
      return
    }

    let data = await Lesson.find({grade: grade_name, lesson: lesson_name});

    if (data.length) {
      res.json({message: 'ok', status: 200, data})
    } else {
      res.json({message: 'empty', status: 204, data})
    }
  }

  async addLesson(req, res, next) {
    let {grade_name, lesson_name, level} = req.body;
    let condition = null;

    if (grade_name && lesson_name && level) {
      condition = {grade: grade_name, lesson: lesson_name, level}
    } else {
      res.json({message: 'condition error', status: 400});
      return
    }

    let data = await Lesson.find(condition);
    if (data.length) {
      res.json({message: 'exits', status: 200, data})
    } else {
      data = await Lesson.create({
        //todo session
        creator: 'fsy',
        create_time: new Date(),
        ...condition
      });
      res.json({status: 200, message: 'ok', data})
    }
  }

  async updateLesson(req, res) {
    console.log(req.body);
    let {grade_name, lesson_name, level, title, content} = req.body;
    let condition = null;

    if (grade_name && lesson_name && level && title && content) {
      condition = {grade: grade_name, lesson: lesson_name, level}
    } else {
      res.json({message: 'condition error', status: 400});
      return
    }

    let data = await Lesson.findOne(condition);
    data.get('feedBacks').push({
      creator: 'fsy',
      title,
      content: {
        title: 'lala',
        img: 'data:image/jpeg;base64,',
        description: 'foo'
      }
    });
    await data.save();
    res.json({message: 'ok', status: 200, data})
  }
}


module.exports = new Lessons();
